function getMultipleValues(a){const b=document.getElementById(a).selectedOptions;let index=0,selectedValue,selectedValues=[];for(index;index<b.length;index++){if(b[index].selected){selectedValue=b[index].value;if(selectedValue===-1){selectedValues=[-1];break}selectedValues.push(b[index].value)}}return selectedValues}function mergeMultipleUnique(){const a=[];let argIndex=0,itemIndex=0;for(argIndex;argIndex<arguments.length;argIndex++){if(Array.isArray(arguments[argIndex])){for(itemIndex;itemIndex<arguments[argIndex].length;itemIndex++){if(a.indexOf(arguments[argIndex][itemIndex])===-1){a.push(arguments[argIndex][itemIndex])}}}}return a}function setMultipleValues(a,b){const c=document.getElementById(a).options;let index=0;for(index;index<c.length;index++){if(b.indexOf(c[index].value)!==-1){c[index].setAttribute("selected","selected")}}};